import React from 'react';

const MyCourses = () => {
  return (
    <div className="my-courses">
      <h1>내 강의 목록</h1>
      <p>여기에 사용자가 등록한 강의 목록이 표시됩니다.</p>
      {/* 강의 목록 컴포넌트를 여기에 추가할 수 있습니다. */}
    </div>
  );
};

export default MyCourses;
